import Link from 'next/link';

const linkStyle = {
    marginRight: 15
};

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/episodes">
            <a style={linkStyle}>Episodes</a>
        </Link>
    </div>
);

export default Header;
